create table "COUNTRIES" 
    (	
        "COUNTRIES_ID"      NUMBER GENERATED ALWAYS as IDENTITY(START with 1 INCREMENT by 1), 
        "COUNTRIES_ISO"     VARCHAR2(2) NOT NULL ENABLE, 
        "RAW_NAME"          VARCHAR2(80) NOT NULL ENABLE, 
        "FORMATTED_NAME"    VARCHAR2(280) NOT NULL ENABLE, 
        "COUNTRY_ISO3"      VARCHAR2(3) DEFAULT NULL, 
        "COUNTRY_CODE"      NUMBER(6,0) DEFAULT NULL, 
        "CALLING_CODE"      NUMBER(5,0) NOT NULL ENABLE, 
        "CREATED_ON"        TIMESTAMP(6) WITH TIME ZONE default SYSTIMESTAMP 
    );


commit;
